;; **
;;; ### Scatter Plot (X: similarity with 홍문종, Y: similarity with 염동열) where similarity = sample mean of MVN.
;;; 
;;; `TODO:` 컬러를 당별로 바꿔보면 뭔가가 보일까?
;; **

;; @@
(def scatter-points
  (map (fn [entry] [(second (first entry)) (second (second entry))]) ; x: 홍문종, y: 염동열
    (map vector hong yeom)))
